            String[] chars = Regex.Split(Regex.Replace(s, @"\s+", ""), @"([*/+-])");
            List<int> values = new List<int>();
            List<string> operations = new List<string>();
            foreach(string c in chars)
            {
                int outcome;
                if(int.TryParse(c, out outcome))
                    values.Add(outcome);
                else
                    operations.Add(c);
            }
            for (int pass = 0; pass < 2; pass++)
            {
                if (!(operations.Contains("*") && operations.Contains("/"))) pass++;
                for (int o = 0; o < operations.Count; o++)
                {
                    switch (operations[o])
                    {
                        case "*":
                            values[o] = values[o] * values[o + 1];
                            break;
                        case "/":
                            values[o] = values[o] / values[o + 1];
                            break;
                        case "+":
                            if (pass == 0) continue;
                            values[o] = values[o] + values[o + 1];
                            break;
                        case "-":
                            if (pass == 0) continue;
                            values[o] = values[o] - values[o + 1];
                            break;

                    }
                    operations.RemoveAt(o);
                    values.RemoveAt(o + 1);
                    o--;
                }
            }
            return values[0];
        }
    }
}
